SELECT user_id, event_count
FROM (
    SELECT user_id, COUNT() AS event_count
    FROM events
    GROUP BY user_id
)
WHERE event_count > (
    SELECT COUNT() / COUNT(DISTINCT user_id) 
    FROM events
);

